  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115680 includes chemical,
  discrete sample, physical and profile data collected from JOHAN HJORT in the North
  Greenland Sea and Norwegian Sea from 1996-10-30 to 1996-11-10 and retrieved during
  cruise CARINA/58JH19961030. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113
  (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DELTA HELIUM-3,
  DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential
  temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen isotope), WATER TEMPERATURE
  and methyl chloroform (MC). The instruments used to collect these data include CTD
  and bottle. These data were collected by J. Blindheim and F. Rey of Institute of
  Marine Research - Norway as part of the CARINA/58JH19961030 data set.nnThe CARINA
  (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
  collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
  a merged internally consistent data set of open ocean subsurface measurements for
  biogeochemical investigations, in particular, studies involving the carbon system.
  The original focus area was the North Atlantic Ocean, but over time the geographic
  extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
  Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
